  false,\n\t\"url\": null,\n\t\"notes\": \"The native grassland ecosystem of the northern
  prairie has been substantially impacted during the last 100 years, resulting in
  significant population declines for many of the bird species endemic to this region
  (Knopf 1994). In 1996, U.S. Fish and Wildlife Service and Point Reyes Bird Observatory
  cooperated on this study to focus on the breeding ecology of Sprague's Pipit (Anthus
  spragueii) and Baird's Sparrow (Ammodramus bairdii). Our objectives are to describe
  and monitor the reproductive natural history and ecology of the grassland passerine
  species nesting in undisturbed mixed-grass prairie. Data collection efforts began
  with a pilot study during the summer of 1996, and have continued annually thereafter,
  concentrating on nest searching and monitoring, point count surveys, territory mapping,
  color banding, and measuring nest site habitat characteristics. We collected data
  on population density, territory size, nesting success, predation, brood parasitism
  and vegetation. This report will summarize the methods and results for the data
  from 1996 through 1999, focusing on 1999. In 1999, we monitored 143 nests of 10
  species, including 16 nests of Sprague's Pipit and 7 nest of Baird's Sparrow; across
  all years we have monitored 664 nests of 14 species. Brownheaded Cowbird parasitism
  was estimated at 4.5% (n = 134) in 1999, and 11% (n = 548) for all sites, species
  and years. We color banded 115 individuals in 1999 and have color-banded 3 3 I nestlings
  and 73 adults across all years. Adult returns were estimated at 7.6% (n = 26) for
  Baird's Sparrow and 0.0% (n = 6) for Sprague's Pipit.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
